import React, { useEffect, useState } from 'react';
import API from '../api';

const EmployeeList = () => {
  const [employees, setEmployees] = useState([]);

  useEffect(() => {
    API.get('/api/employees').then(res => setEmployees(res.data));
  }, []);

  return (
    <div>
      <h2>Employees</h2>
      <ul>
        {employees.map(emp => (
          <li key={emp._id}>
            {emp.name} - {emp.email}
            <img src={emp.photo} alt="" height="50" />
          </li>
        ))}
      </ul>
    </div>
  );
};

export default EmployeeList;
